import {createMuiTheme} from '@material-ui/core/styles';


const theme = createMuiTheme({
    typography: {
        useNextVariants: true, 
        fontFamily: [
            'Roboto, Arial',
            '"Bebas Neue"'
    ]
    },
    palette: {
        primary: {
            light: '#9e9e9e',
            main: '#212121',
            dark: '#006db3',
            contrastText: '#fafafa',
        },
        contrastText: {
            main: '#9e9e9e'
        },
        type: "dark"
    },
    shape: {
        borderRadius: 10
    },
    paper: {

    }
    
});

export default theme;
